export default class Feedback extends Component {
  state = {
    // highlights: []
    highlights: TEST_HIGHLIGHTS
  }

  componentDidMount() {
    window.addEventListener('hashchange', this.scrollToHighlightFromHash, false)
  }

  getHighlightById(id) {
    const { highlights } = this.state

    return highlights.find(highlight => highlight.id === id)
  }

  scrollToHighlightFromHash = () => {
    const highlight = this.getHighlightById(parseIdFromHash())

    if (highlight) {
      this.scrollViewerTo(highlight)
    }
  }

  addHighlight(highlight) {
    const { highlights } = this.state

    this.setState({
      highlights: [{ ...highlight, id: uuid(), created: Date.now() }, ...highlights]
    })
  }

  handleUpdateHighlight(highlightId, position, content) {
    this.setState({
      highlights: this.state.highlights.map(h => {
        return h.id === highlightId
          ? {
              ...h,
              position: { ...h.position, ...position },
              content: { ...h.content, ...content }
            }
          : h
      })
    })
  }

  handleDeleteHighlight = (id) => {
    this.setState({
      highlights: this.state.highlights.reduce((highlights, highlight) => {
        if (highlight.id !== id) {
          highlights.push(highlight)
        }

        return highlights
      }, [])
    })
  }

  render() {
    const { highlights } = this.state

    return (
      <div className="Feedback">
        <Sidebar highlights={highlights} onDeleteHighlight={this.handleDeleteHighlight} />

        <div className="pdf-wrap">
          <PdfLoader url={TEST_URL} beforeLoad={<Spinner />}>
            {pdfDocument => (
              <PdfHighlighter
                pdfDocument={pdfDocument}
                onScrollChange={() => (window.location.hash = '')}
                scrollRef={scrollTo => {
                  this.scrollViewerTo = scrollTo
                  this.scrollToHighlightFromHash()
                }}
                enableAreaSelection={e => e.altKey}
                onSelectionFinished={(
                  position,
                  content,
                  hideTipAndSelection,
                  transformSelection,
                ) => (
                  <Tip
                    onOpen={transformSelection}
                    onConfirm={comment => {
                      this.addHighlight({ content, position, comment })

                      hideTipAndSelection()
                    }}
                  />
                )}
                highlightTransform={(
                  highlight,
                  index,
                  setTip,
                  hideTip,
                  viewportToScaled,
                  screenshot,
                  isScrolledTo,
                ) => {
                  const isTextHighlight = !Boolean(
                    highlight.content && highlight.content.image
                  )

                  const component = isTextHighlight ? (
                    <Highlight
                      isScrolledTo={isScrolledTo}
                      position={highlight.position}
                      comment={highlight.comment}
                    />
                  ) : (
                    <AreaHighlight
                      highlight={highlight}
                      onChange={boundingRect => {
                        this.handleUpdateHighlight(
                          highlight.id,
                          { boundingRect: viewportToScaled(boundingRect) },
                          { image: screenshot(boundingRect) }
                        )
                      }}
                    />
                  )

                  return (
                    <Popup
                      popupContent={<HighlightPopup {...highlight} />}
                      onMouseOver={popupContent =>
                        setTip(highlight, highlight => popupContent)
                      }
                      onMouseOut={hideTip}
                      key={index}
                      children={component}
                    />
                  )
                }}
                highlights={highlights}
              />
          )}
          </PdfLoader>
        </div>
      </div>
    )
  }
}

const parseIdFromHash = () => window.location.hash.slice('#highlight-'.length)

const HighlightPopup = ({ comment }) =>
  comment.text ? (
    <div className="Highlight__popup">
      {comment.emoji} {comment.text}
    </div>
  ) : null

const Spinner = () => (
  <Icon className="Spinner" icon="spinner" spin />
)
